    function sortBySize(props){
        return
        (
            props.data.sort((a, b) => b.area - a.area)
        )
    }

    return (

    <>
    <div>
        
    <div className="countryInfo">
        <p className="countryName">{props.data.name.common}</p>
        <p>{props.data.area} KM <sup>2</sup> </p>
    </div>

    </div>

    </>

    )
}



export default CountryInfo;
